import React from 'react';
import { Link, useParams } from 'react-router-dom';

function Study({decks}) {
    const { deckId } = useParams();
    const currentDeck = decks.find(({id}) => {id === deckId});
    const { name } = currentDeck;
    return (
        <nav aria-label="breadcrumb">
            <ol class="breadcrumb">
                <li class="breadcrumb-item"><Link to={"/"}><i class="fa fa-home" aria-hidden="true"></i> Home</Link></li>
                <li class="breadcrumb-item"><Link href="#">{name}</Link></li>
                <li class="breadcrumb-item active" aria-current="page">Study</li>
            </ol>
        </nav>
    )
}

export default Study;
